import axios from "axios";

let url="GET https://api.myanimelist.net/v2/anime/10357?fields=rank,mean,alternative_titles";

const Home = () => {

    useEffect(() =>
    {

        async () =>
        {
            try
            {
                const res = await axios.get(url, { headers: {"X-MAL-CLIENT-ID" : "8a6c31ab170d838f7326b3240448af67"}});
                console.log(res.data);
            }
            catch(err)
            {
                console.log(err);
            }
        }


    }, [])

    return (
        <div>
            
        </div>
    )
}

export default Home;
